import React,{Component} from "react";
import{Div0,Selectleft,Selectcenter}from'./style';
class SelectList extends Component{
    render(){
        return (
            <Div0>
                <Selectleft>
                    <option>全體</option>
                    <option>個人</option>
                </Selectleft>
                <Selectcenter>
                    <option>全體</option>
                    <option>個人</option>
                </Selectcenter>
            </Div0>
        )}}
export default SelectList;
